import React, { Component } from 'react';
import './component.css'
import headerImg from '..assets/h-img.jpg'

class Header extends Component {
    render(){
        return(
            <header className='header'>
                <div className='header-body'>
                    <div>
                        The endless benefits of endless possibilities
                        Your number one source for all solutions with coding. We're dedicated
                        to providing you the very best of coding solutions, with an emphasis 
                        on effectiveness, timely delivery and client satisfaction.
                    </div>
                    <div><img src={headerImg} alt="header-img" /></div>
                </div>
            </header>
        );
    }
}

export default Header;
